- request:
    body: '{"input": ["And so many families are living paycheck to paycheck, struggling
      to keep up with the rising cost of food, gas, housing, and so much more.   I
      understand.   I remember when my Dad had to leave our home in Scranton, Pennsylvania
      to find work. I grew up in a family where if the price of food went up, you
      felt it.   That\u2019s why one of the first things I did as President was fight
      to pass the American Rescue Plan.    Because people were hurting. We needed
      to act, and we did.   Few pieces of legislation have done more in a critical
      moment in our history to lift us out of crisis.   It fueled our efforts to vaccinate
